import './App.css';

function App() {
  return (
    <div className="App">
      <div className='card'>
      <div className='logreg'>
      <button className='loginbtn'>Login</button>
      <button className='registerbtn' style={{border: '2px solid rgb(120, 227, 120)'}}>Register as</button>
      </div>
      </div>
    </div>
  );
}

export default App;
